import Vue from 'vue'
import VueRouter from 'vue-router'
import customer from '../components/serives/customerTable.vue'
Vue.use(VueRouter)

const routes = [

 {
  path:'/customer',
  name:'customer',
  component:customer
 }

]

// eslint-disable-next-line no-new
const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
